  false,\n\t\"url\": null,\n\t\"notes\": \"The Expeditions Information System (EIS)
  contains information recorded by the NOAA Office of Ocean Exploration's data manager
  during the 2002 \"Islands in the Stream - Exploration of Outer Shelf and Slope Habitats
  off the Coast of North Carolina\" expedition, August 5 - 15, 2002. Information contained
  in the EIS included a record of all non-dive activities carried out during the expedition.
